INSERT INTO `sys_oper_log` VALUES (2501, '目录列', 2, 'com.ruoyi.web.controller.biz.PicDirectoryController.edit()', 'PUT', 1, 'admin', NULL, '/biz/directory', '106.224.83.27', 'XX XX', '{\"priceRew\":0,\"introduce\":\"<p>我们的AI算法，经过数十万张图片的不断调试，可以很好的将上传脸图的面部特征，和底图模特的表情动作妆容相融合，得到令人满意的旅游打卡照。为了更好的生成照片，请务必阅读以下内容，并按照步骤要求操作：</p><p>1、本图用于测试您的照片的生成效果，请满意后在将照片制作相册批量出图。</p><p>2、脸图要求：请上传您脸部正面大头照，表情自然，如下图效果更佳，请不要上传多人、侧面、脸部过小、光影复杂和遮挡脸部的照片，均难以生成满意照片。</p><p>特别注意：古装照片不要上传戴眼镜的照片。</p><p><img src=\\\"https://www.lilanai.com/profile/upload/myPic/20240821194848A011.jpg\\\"></p><p>3、预处理：您上传的图片请用美颜软件做适当调整，以便于生成的照片效果更贴近您的审美需求，图片尺寸不高于2000x2000像素，文件大小不超过2M。</p><p>4、后期处理：图片生成后，仍存在一点瑕疵的，可以用美颜/修图软件修除瑕疵。</p><p>5、不适用的顾客：由于技术所限，对于很少一部分用户仍无法抓取其面部特征，生成效果不佳，请更换其他照片测试。多张仍不满意的，请不要进行付费生图避免损失。</p><p>本相册生图效果：</p><p><img src=\\\"https://www.lilanai.com/profile/upload/myPic/20240821193955A010.jpg\\\"></p>\",\"usageTimes\":0,\"updateTime\":1725238454539,\"numberRew\":0,\"params\":{},\"supDirectoryId\":51,\"numberFoun\":1,\"createTime\":1723886676000,\"directoryLevel\":\"3\",\"price\":2,\"directoryUrl\":\"https://ceshi-1319563048.cos.ap-nanjing.myqcloud.com/myPic//profile/upload/2024/09/02/20240902085201A001.jpg\",\"directoryTag\":\"0\",\"id\":52,\"directoryName\":\"测试图：女将军\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-09-02 08:54:14');
