INSERT INTO `sys_oper_log` VALUES (4140, '目录列', 2, 'com.ruoyi.web.controller.biz.PicDirectoryController.edit()', 'PUT', 1, 'admin', NULL, '/biz/directory', '27.193.10.71', 'XX XX', '{\"priceRew\":0,\"introduce\":\"<p>信号山，最早因指挥进出胶州湾的船只，而在山顶建信号发布台而得名。山上小路<span style=\\\"color: rgb(51, 51, 51);\\\">曲折回转，蜿蜒于林荫之下，九曲环绕见，便可见岛城美景在山间林径展现，到山顶观景台，红瓦绿树碧海蓝天尽收眼底，岛城二十四景之“旗山远眺”就此得名。</span></p><p>注意：</p><p>1、请先在免费试用板块确认自己适合生图的照片，并认可出图效果再行抽图生成。</p><p>2、如您的容貌轮廓、胖瘦与示例图片相差过大，则生成效果不会太好，请不要尝试生图。</p><p>3、本套系生图3张，需消耗100积分，试运行期间，再加送6张，确保结果令人满意。</p><p>部分照片展示：</p><p><img src=\\\"https://lilanai.com/myPic/2024/09/11/20240911180848A383.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/11/20240911180851A384.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/11/20240911180853A385.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/11/20240911180856A386.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/11/20240911180858A387.jpg\\\"></p>\",\"usageTimes\":0,\"updateTime\":1726061292973,\"numberRew\":0,\"params\":{},\"supDirectoryId\":91,\"numberFoun\":9,\"createTime\":1726049209000,\"directoryLevel\":\"3\",\"price\":100,\"directoryUrl\":\"https://lilanai.com/myPic/2024/09/11/20240911180627A382.jpg\",\"directoryTag\":\"0\",\"id\":92,\"directoryName\":\"信号山\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-09-11 21:28:13');
