INSERT INTO `sys_oper_log` VALUES (4252, '目录列', 2, 'com.ruoyi.web.controller.biz.PicDirectoryController.edit()', 'PUT', 1, 'admin', NULL, '/biz/directory', '27.193.10.71', 'XX XX', '{\"priceRew\":0,\"introduce\":\"<p>“总督楼”位于有青岛“龙脉”之誉的五龙山（即信号山）龙首，始建于清光绪二十九年（1903年），作为德国胶澳总督官邸在岛城历史上有举足轻重的地位，现为青岛德国总督楼旧址博物馆。作为“德国建筑艺术在中国”的最高代表，为中国单体建筑首列，是融合东西方多种文化理念于一体的建筑艺术巨制，具有较高的历史价值</p><p>注意：</p><p>1、请先在免费试用板块确认自己适合生图的照片，并认可出图效果再行抽图生成。</p><p>2、如您的容貌轮廓、胖瘦与示例图片相差过大，则生成效果不会太好，请不要尝试生图。</p><p>3、本套系生图3张，需消耗100积分，试运行期间，再加送6张，确保结果令人满意。</p><p>部分照片展示：</p><p><img src=\\\"https://lilanai.com/myPic/2024/09/12/20240912193954A542.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/12/20240912193957A543.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/12/20240912193959A544.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/12/20240912194002A545.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/12/20240912194005A546.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/12/20240912194007A547.jpg\\\"></p>\",\"usageTimes\":10,\"updateTime\":1726141215965,\"numberRew\":0,\"params\":{},\"supDirectoryId\":94,\"numberFoun\":20,\"createTime\":1726115030000,\"directoryLevel\":\"3\",\"price\":100,\"directoryUrl\":\"https://lilanai.com/myPic/2024/09/12/20240912122328A466.jpg\",\"directoryTag\":\"0\",\"id\":95,\"directoryName\":\"总督楼A\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-09-12 19:40:15');
