INSERT INTO `sys_oper_log` VALUES (4421, '目录列', 2, 'com.ruoyi.web.controller.biz.PicDirectoryController.edit()', 'PUT', 1, 'admin', NULL, '/biz/directory', '27.193.10.71', 'XX XX', '{\"priceRew\":0,\"introduce\":\"<p>八大关是最能体现青岛“红瓦绿树、碧海蓝天”特点的风景区，这里以包括超过8条以“关”命名的街道，其间布满众多的欧式古典建筑，少数建于德国统治时期，大部分兴建于1930年代前后，这里不仅展示了丰富的历史文化，更以独特的建筑风格和迷人的景色吸引了无数游客。</p><p>本组照片以著名的花石楼和太平角的城市海岸为背景，展示优雅的城市风情。</p><p>注意：</p><p>1、请先在免费试用板块确认自己适合生图的照片，并认可出图效果再行抽图生成。</p><p>2、如您的容貌轮廓、胖瘦与示例图片相差过大，则生成效果不会太好，请不要尝试生图。</p><p>3、本套系生图3张，需消耗100积分，试运行期间，再加送6张，确保结果令人满意。</p><p>本组部分示例图片：</p><p><img src=\\\"https://lilanai.com/myPic/2024/09/22/20240922115815A684.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/22/20240922115818A685.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/22/20240922115820A686.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/22/20240922115824A687.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/22/20240922115826A688.jpg\\\"></p>\",\"usageTimes\":5,\"updateTime\":1726980260685,\"numberRew\":0,\"params\":{},\"supDirectoryId\":89,\"numberFoun\":9,\"createTime\":1726977268000,\"directoryLevel\":\"3\",\"price\":100,\"directoryUrl\":\"https://lilanai.com/myPic/2024/09/22/20240922115413A683.jpg\",\"directoryTag\":\"0\",\"id\":102,\"directoryName\":\"花石楼和太平角海滨\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-09-22 12:44:20');
