INSERT INTO `sys_oper_log` VALUES (4722, '目录列', 2, 'com.ruoyi.web.controller.biz.PicDirectoryController.edit()', 'PUT', 1, 'admin', NULL, '/biz/directory', '27.193.10.71', 'XX XX', '{\"priceRew\":0,\"introduce\":\"<p>栈桥及回澜阁，始建于清光绪十七年（1891年），素有“长虹远引”之誉，是青岛最具代表性和知名度的城市地标之一。</p><p>注意：</p><p>1、请先在免费试用板块确认自己适合生图的照片，并认可出图效果再行抽图生成。</p><p>2、如您的容貌轮廓、胖瘦与示例图片相差过大，则生成效果不会太好，请不要尝试生图。</p><p>3、本套系生图3张，需消耗100积分，试运行期间，再加送3张，确保结果令人满意。</p><p>部分照片展示：</p><p><img src=\\\"https://lilanai.com/myPic/2024/09/10/20240910112514A307.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/10/20240910112518A308.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/10/20240910112521A309.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/10/20240910112524A310.jpg\\\"></p>\",\"usageTimes\":10,\"updateTime\":1727243540209,\"numberRew\":0,\"params\":{},\"supDirectoryId\":91,\"numberFoun\":6,\"createTime\":1725938668000,\"directoryLevel\":\"3\",\"price\":100,\"directoryUrl\":\"https://lilanai.com/myPic/2024/09/10/20240910112419A306.jpg\",\"directoryTag\":\"0\",\"id\":87,\"directoryName\":\"栈桥\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-09-25 13:52:20');
INSERT INTO `sys_oper_log` VALUES (4723, '目录列', 2, 'com.ruoyi.web.controller.biz.PicDirectoryController.edit()', 'PUT', 1, 'admin', NULL, '/biz/directory', '27.193.10.71', 'XX XX', '{\"priceRew\":0,\"introduce\":\"<p>圣弥厄尓大教堂，<span style=\\\"color: rgb(51, 51, 51);\\\">始建于民国二十一年（1932年），由德国设计师毕娄哈依据哥特式和罗马式风格而设计，是青岛红瓦绿树城市形象的核心景观之一，也是青岛打卡圣地。</span></p><p><span style=\\\"color: rgb(51, 51, 51);\\\">本组相册拍摄于教堂前广场与院内，内景和远景可以参考另一相册作品。</span></p><p>注意：</p><p>1、请先在免费试用板块确认自己适合生图的照片，并认可出图效果再行抽图生成。</p><p>2、如您的容貌轮廓、胖瘦与示例图片相差过大，则生成效果不会太好，请不要尝试生图。</p><p>3、本套系生图3张，需消耗100积分，试运行期间，再加送6张，确保结果令人满意。</p><p>部分照片展示：</p><p><img src=\\\"https://lilanai.com/myPic/2024/09/07/20240907181224A008.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/07/20240907181230A009.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/07/20240907181301A010.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/07/20240907181307A011.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/07/20240907181313A012.jpg\\\"><img src=\\\"https://lilanai.com/myPic/2024/09/07/20240907181318A013.jpg\\\"></p>\",\"usageTimes\":10,\"updateTime\":1727243598932,\"numberRew\":0,\"params\":{},\"supDirectoryId\":86,\"numberFoun\":9,\"createTime\":1725703097000,\"directoryLevel\":\"3\",\"price\":100,\"directoryUrl\":\"https://lilanai.com/myPic/2024/09/09/20240909232120A290.jpg\",\"directoryTag\":\"0\",\"id\":77,\"directoryName\":\"圣弥厄尔大教堂外景\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2024-09-25 13:53:18');
